 Sure, I'll explain binary trees in Python.

Binary trees are a type of data structure that organizes data into a hierarchical structure where each node in the tree has up to two child nodes. The child nodes can either be empty or contain data. Binary trees are typically used to represent hierarchical data, such as a directory structure or a file system, where a node can contain either a file or a folder.

In Python, we use the "BST" or "binary search tree" structure to represent binary trees. A BST is a self-balanced binary tree data structure that ensures log(n) search, insert, and delete operations.

Here's an example of a binary tree representation in Python:
```
class Node:
    def __init__(self, data):
        self.data = data
        self.left_child = None
        self.right_child = None

    def __repr__(self):
        return 'Node(data={}, left_child={}, right_child={})'.format(self.data, self.left_child, self.right_child)

class BinaryTree:
    def __init__(self):
        self.root = None

    def insert(self, data):
        if self.root == None:
            self.root = Node(data)
        else:
            self.insert_rec(self.root, data)

    def insert_rec(self, node, data):
        if data < node.data:
            if node.left_child == None:
                node.left_child = Node(data)
            else:
                self.insert_rec(node.left_child, data)
        else:
            if node.right_child == None:
                node.right_child = Node(data)
            else:
                self.insert_rec(node.right_child, data)

    def __repr__(self):
        return 'BinaryTree(root={})'.format(self.root)
```
